(2, 1, 'AMANOVA POUCH P12 STERILISED FISH GATO 85GR', '', '<p>\r\n	<span style=\"font-family: Gotham, sans-serif; font-size: 18px; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; text-transform: uppercase; font-weight: inherit;\">PESCADO Y PAVO FRESCO</span></p>\r\n<div class=\"product-nutricional__main js-accordions\" style=\"box-sizing: border-box; outline: none; box-shadow: none; padding: 0px; border: 0px; font: inherit; vertical-align: middle; flex: 1 1 0%; width: 490.508px; margin: 0px auto !important; display: inline-block !important;\">\r\n	<div class=\"js-tab tab-index--1 js-active\" data-id=\"tab-descripcion\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; width: 490.508px; left: 0px;\">\r\n		<div class=\"product-nutricional__inner\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; width: 490.508px;\">\r\n			<p class=\"paragraph-hightlighted\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n				&iexcl;El alimento diario perfecto para los gatos esterilizados! Esta deliciosa comida sin cereales es nutricionalmente completa y est&aacute; elaborada con pescado blanco fresco y carne de pavo y pollo de primer&iacute;sima calidad.</p>\r\n			<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline;\">\r\n				Su sabrosa receta est&aacute; cocinada a fuego lento en nuestra propia cocina e incluye ingredientes nutritivos y de f&aacute;cil digesti&oacute;n, como guisantes llenos de vitaminas y algas ricas en minerales. Para garantizar la salud y el bienestar de tu amigo felino, esta comida h&uacute;meda incorpora vitaminas C, D3 y E, as&iacute; como minerales quelados que mejoran la absorci&oacute;n de los nutrientes. Su contenido en taurina natural ayuda a cuidar la salud del coraz&oacute;n y de los ojos y la L-carnitina facilita el proceso de metabolizaci&oacute;n de las grasas. Este alimento es justo lo que tu gato esterilizado necesita cada d&iacute;a para vivir sano y feliz.</p>\r\n			<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline;\">\r\n				<span style=\"color: rgb(85, 87, 91); font-family: Gotham, serif; font-size: 15px; text-align: center;\">&nbsp;</span></p>\r\n			<div class=\"product-nutricional__main js-accordions\" style=\"box-sizing: border-box; outline: none; box-shadow: none; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Gotham, serif; vertical-align: middle; flex: 1 1 0%; width: 490.508px; color: rgb(85, 87, 91); margin: 0px auto !important; display: inline-block !important;\">\r\n				<div class=\"js-tab tab-index--2 js-active\" data-id=\"tab-ingredientes\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; width: 490.508px; left: 0px;\">\r\n					<div class=\"product-nutricional__inner\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; width: 490.508px;\">\r\n						<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline;\">\r\n							<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPOSICI&Oacute;N:</span>Pollo, pavo y pescado blanco 92%. (Caldo de pollo 31%, pavo preparado en fresco 30%, pollo preparado en fresco 21%, pescado blanco preparado en fresco 10%). Guisantes 5%. Fibra de guisantes 0.5%. Minerales. Alga kelp 0,02%.</p>\r\n						<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline;\">\r\n							<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPONENTES ANAL&Iacute;TICOS:</span>&nbsp;prote&iacute;na bruta 10,50%, grasa bruta 4,50%, &aacute;cidos grasos omega-3 0,35%, &aacute;cidos grasos omega-6 0,80%, EPA + DHA 1750 mg/kg, fibra bruta 1,25%, ceniza bruta 1,75%, humedad 78,00%. Energ&iacute;a metabolizable 94,5 kcal/kg.</p>\r\n						<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline;\">\r\n							<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">ADITIVOS:</span>&nbsp;Aditivos nutricionales: Vitamina D3 240 IU/kg. Vitamina E 100 mg/kg. Vitamina C 550 mg/kg. Manganeso (quelato de manganeso de amino&aacute;cidos hidratado) 4,5 mg/kg. Zinc (quelato de zinc de amino&aacute;cidos hidratado) 15 mg/kg. Cobre (quelato de cobre de amino&aacute;cidos hidratado) 1 mg/kg. Taurina 800 mg/kg. L-carnitina 100 mg/kg.</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '', '', '', 62),
(3, 1, 'AMANOVA POUCH P10 STERILISED CHICKEN GATO 85GR', '', '<p class=\"product-racionamiento__additional-tags\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 1.2; font-family: Gotham, sans-serif; vertical-align: baseline; text-transform: uppercase; color: rgb(85, 87, 91);\">\r\n	POLLO FRESCO</p>\r\n<p class=\"paragraph-hightlighted\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Ideal para mascotas esterilizadas, esta deliciosa comida h&uacute;meda para gatos es nutricionalmente completa, no contiene cereales y est&aacute; elaborada con pollo fresco de primer&iacute;sima calidad.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Su sabrosa receta est&aacute; cocinada a fuego lento en nuestra propia cocina e incluye otros ingredientes naturales, como guisantes repletos de vitaminas y algas ricas en minerales. Para garantizar la salud y el bienestar de tu amigo felino, nuestra comida h&uacute;meda de pollo incorpora vitaminas C, D3 y E, as&iacute; como minerales quelados que mejoran la absorci&oacute;n de los nutrientes. Su contenido en taurina natural ayuda a cuidar la salud del coraz&oacute;n y de los ojos y la L-carnitina facilita el proceso de metabolizaci&oacute;n de las grasas. Este alimento es perfecto para la dieta diaria de tu minino, ya que tiene todo lo que un gato sano y feliz necesita. Y adem&aacute;s, &iexcl;su sabor es irresistible!</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPOSICI&Oacute;N:</span>Pollo 91 % (pollo preparado en fresco 65 %, caldo de pollo 26%). Guisantes 5,5%. Fibra de guisantes 1%. Minerales. Alga kelp 0.02%</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPONENTES ANAL&Iacute;TICOS:</span>prote&iacute;na bruta 10,50%, grasa bruta 5,00%, fibra bruta 1,50%, ceniza bruta 1,50%, humedad 80,00%. Energ&iacute;a metabolizable 88 kcal/kg.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">ADITIVOS:</span>&nbsp;Aditivos nutricionales: Vitamina D3 240 IU/kg. Vitamina E 100 mg/kg. Vitamina C 550 mg/kg. Manganeso (quelato de manganeso de amino&aacute;cidos hidratado) 4 mg/kg. Zinc (quelato de zinc de amino&aacute;cidos hidratado) 15 mg/kg. Cobre (Quelato de cobre de amino&aacute;cidos hidratado) 1 mg/kg. Taurina 800 mg/kg. L-carnitina 100 mg/kg.</p>', '', '', '', '', '', 43),
(4, 1, 'AMANOVA POUCH P13 CORDERO PAVO Y SARDINA GATO 85GR', '', '<p class=\"product-racionamiento__additional-tags\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 1.2; font-family: Gotham, sans-serif; vertical-align: baseline; text-transform: uppercase; color: rgb(85, 87, 91);\">\r\n	CORDERO Y SARDINAS</p>\r\n<p class=\"paragraph-hightlighted\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	&iexcl;El alimento diario perfecto para los gatos esterilizados! Esta comida h&uacute;meda sin cereales es nutricionalmente completa y est&aacute; elaborada con carne fresca de cordero, sardinas, pollo y pavo.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Su deliciosa receta est&aacute; cocinada a fuego lento en nuestra propia cocina e incluye otros ingredientes naturales, como sabrosas algas ricas en minerales y llenas de beneficios para la salud de tu mascota. Para mantener a tu amigo felino en las mejores condiciones, este alimento completo para gatos esterilizados incorpora vitaminas C, D3 y E, as&iacute; como minerales quelados que mejoran la absorci&oacute;n de los nutrientes. Adem&aacute;s, su contenido en taurina natural ayuda a cuidar la salud del coraz&oacute;n y de los ojos. Deliciosa y nutritiva, esta comida seguro que har&aacute; las delicias de tu minino.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPOSICI&Oacute;N:</span>Pollo, sardinas y cordero 97% (pavo preparado en fresco 40%, caldo de pavo 26%, pollo preparado en fresco 11%, sardinas preparadas en fresco 10%, cordero preparado en fresco 10%), minerales, alga kelp 0,02%.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPONENTES ANAL&Iacute;TICOS:</span>prote&iacute;na bruta 10,00%, grasa bruta 6,00%, &aacute;cidos grasos omega-3 0,33%, &aacute;cidos grasos omega-6 0,70%, EPA + DHA 1750 mg/kg, fibra bruta 0,70%, ceniza bruta 2,30%, humedad 79,00%. Energ&iacute;a metabolizable 102 kcal/kg.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">ADITIVOS:</span>&nbsp;Aditivos nutricionales: Vitamina D3 240 IU/kg. Vitamina E 100 mg/kg. Vitamina C 550 mg/kg. Manganeso (quelato de manganeso de amino&aacute;cidos hidratado) 2,3 mg/kg. Zinc (quelato de zinc de amino&aacute;cidos hidratado) 13 mg/kg. Cobre (quelato de cobre de amino&aacute;cidos hidratado) 1 mg/kg. Taurina 800 mg/kg.</p>', '', '', '', '', '', 38),
(5, 1, 'AMANOVA POUCH P14 TERNERA Y POLLO GATO 85GR', '', '<p class=\"product-racionamiento__additional-tags\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 1.2; font-family: Gotham, sans-serif; vertical-align: baseline; text-transform: uppercase; color: rgb(85, 87, 91);\">\r\n	TERNERA Y POLLO FRESCO</p>\r\n<p class=\"paragraph-hightlighted\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Esta deliciosa combinaci&oacute;n de carne fresca de pollo y ternera no contiene cereales, es nutricionalmente completa y est&aacute; cocinada a fuego lento en nuestra propia cocina.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Nuestra exclusiva receta est&aacute; elaborada con aceite de pescado y algas ricas en minerales, ingredientes naturales que, adem&aacute;s de mucho sabor, aportan beneficios para la salud de tu mascota. Para mantener a tu amigo felino en las mejores condiciones, este alimento h&uacute;medo para gatos incorpora vitaminas C, D3 y E, as&iacute; como minerales quelados que mejoran la absorci&oacute;n de los nutrientes. Adem&aacute;s, su contenido en taurina natural ayuda a cuidar la salud del coraz&oacute;n y de los ojos. Esta comida s&uacute;per premium para gatos tiene todo lo que un minino sano y feliz necesita cada d&iacute;a. Y lo mejor de todo, &iexcl;su sabor es irresistible!</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPOSICI&Oacute;N:</span>Pollo y ternera 97% (pollo preparado en fresco 40%, ternera preparada en fresco 30%, caldo de pollo 27%). Minerales. Aceite de pescado 0,1%. Alga kelp 0,02%.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPONENTES ANAL&Iacute;TICOS:</span>&nbsp;prote&iacute;na bruta 10,00%, grasa bruta 8,00%, fibra bruta 0,60%, ceniza bruta 1,90%, humedad 77,00%. Energ&iacute;a metabolizable 116 kcal/kg.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inher