color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">ADITIVOS NUTRICIONALES:</span>&nbsp;vitamina A 18000 UI/kg, vitamina D3 1750 UI/kg, vitamina E 700 mg/kg, vitamina C 75 mg/kg, hierro (quelato de hierro (II) de amino&aacute;cidos, hidratado) 54 mg/kg, cobre (quelato de cobre (II) de amino&aacute;cidos, hidratado) 5 mg/kg, manganeso (quelato de manganeso de amino&aacute;cidos, hidratado) 20 mg/kg, zinc (quelato de zinc de amino&aacute;cidos, hidratado) 75 mg/kg, selenio (L-seleniometionina) 0&#39;20 mg/kg, DL-metionina 1000 mg/kg, taurina 1000 mg/kg.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">ADITIVOS TECNOL&Oacute;GICOS:</span>&nbsp;Antioxidantes: extractos de tocoferol de aceites vegetales. Reguladores de la acidez: Bisulfato s&oacute;dico 4000 mg/kg.</p>', '', '', '', '', '', 27),
(17, 1, 'AMANOVA ADULT LARGE POLLO FRESCO PERRO 12KG', '', '<p class=\"paragraph-hightlighted2\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Adult Large Pollo Fresco</span></p>\r\n<p class=\"paragraph-hightlighted\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Es un&nbsp;<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">pienso hipoalerg&eacute;nico</span>&nbsp;especial para perros adultos de razas grandes. Preparado con pollo fresco como &uacute;nica fuente animal, contiene protectores osteo-articulares que fortalecer&aacute;n los huesos y m&uacute;sculos.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	