(20, 1, 'AMANOVA ADULT MINI DIGESTIVE CONEJO FRESCO PERRO 7KG', '', '<p class=\"paragraph-hightlighted2\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Adult Mini Digestive Conejo Fresco</span></p>\r\n<p class=\"paragraph-hightlighted\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Amanova Adult Mini Digestive es un pienso digestivo</span>&nbsp;preparado &uacute;nicamente con carne fresca de conejo como &uacute;nica fuente animal, baja en calor&iacute;as, colesterol y grasas, est&aacute; repleta de prote&iacute;nas y minerales esenciales para la salud de tu perro.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Este delicioso&nbsp;<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">pienso para perros sin cereales</span>&nbsp;cuenta con nutrientes y deliciosos s&uacute;per ingredientes como calabaza, ar&aacute;ndanos y zanahoria que potenciar&aacute;n el sistema inmunitario, los &aacute;cidos grasos Omega-3 y Omega 6 ayudar&aacute;n a mantener la piel sana y a conseguir un pelaje suave y brillante.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Amanova Adult Mini Digestive es una receta exclusiva de alta palatabilidad con croquetas de estructura especial para mand&iacute;bulas peque&ntilde;as que no contiene harinas de carne ni carnes deshidratadas. La elecci&oacute;n perfecta para perros peque&ntilde;os con est&oacute;magos sensibles o digestiones delicadas.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPOSICI&Oacute;N:</span>&nbsp;Conejo fresco 51%, patata, guisantes, prote&iacute;na de patata, aceite de pollo, calabaza 2%, hidrolizado de conejo, levaduras, manzana, zanahoria 2%, sustancias minerales, algarroba, semillas de linaza, aceite de pescado, ar&aacute;ndano 0,30%, laurel 0,10%, inulina (FOS), manano-oligosac&aacute;ridos (MOS), jengibre, glucosamina, Yucca schidigera, sulfato de condroitina.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPONENTES ANAL&Iacute;TICOS:&nbsp;</span>Prote&iacute;na bruta 27%, Grasa bruta 17%, &Aacute;cidos grasos omega-3 0,6%, &Aacute;cidos grasos omega-6 2%, Fibras brutas 3,5%, Ceniza bruta 7,5%, Calcio 1,25%, F&oacute;sforo 1,1%, Energ&iacute;a metabolizable 4000 kcal/kg</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">ADITIVOS NUTRICIONALES:</span>&nbsp;Vitamina A 19000 UI/kg, vitamina D3 1750 UI/kg, vitamina E 500 mg/kg, vitamina C 100 mg/kg, hierro (quelato de hierro (II) de amino&aacute;cidos, hidratado) 63 mg/kg, cobre (quelato de cobre (II) de amino&aacute;cidos, hidratado) 5 mg/kg, manganeso (quelato de manganeso de amino&aacute;cidos, hidratado) 24 mg/kg, zinc (quelato de zinc de amino&aacute;cidos, hidratado) 85 mg/kg, Selenio (L-seleniometionina) 0&#39;20 mg/kg, taurina 300 mg/kg, L-carnitina 50 mg/kg.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">ADITIVOS TECNOL&Oacute;GICOS:</span>&nbsp;Antioxidantes: extractos de tocoferol de aceites vegetales.</p>', '', '', '', '', '', 31),
