(22, 1, 'AMANOVA ADULT OBESITY PAVO FRESCO PERRO 2KG', '', '<p class=\"paragraph-hightlighted2\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Adult Obesity Pavo Fresco</span></p>\r\n<p class=\"paragraph-hightlighted\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Amanova Adult Obesity</span>&nbsp;es un&nbsp;<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">pienso hipoalerg&eacute;nico</span>&nbsp;bajo en grasas y elaborado con pavo fresco como &uacute;nica fuente animal, una deliciosa carne rica en prote&iacute;nas, baja en grasas y colesterol.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	La f&oacute;rmula especial de este&nbsp;<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">pienso light, dise&ntilde;ada por los mejores nutricionistas</span>, contiene L-carnitina, que ayudar&aacute; a acelerar la quema de grasas sin que se produzca p&eacute;rdida de masa muscular, la mezcla de almid&oacute;n y fibras especiales provocar&aacute; un efecto saciante al mantener constantes los niveles de glucosa y colesterol en sangre.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Amanova Adult Obesity</span>&nbsp;es una receta deliciosa, no contiene harinas de carne ni carnes deshidratadas. La elecci&oacute;n perfecta para mantener a tu perro en l&iacute;nea.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPOSICI&Oacute;N:</span>&nbsp;pavo preparado en fresco 45% (usamos 67 kg de pavo preparado en fresco para producir 100 kg de nuestro producto), guisantes verdes enteros, prote na de patata, prote&iacute;na de guisantes, arroz integral, lignocelulosa, levaduras (Saccharomyces cerevisiae), hidrolizado de h&iacute;gado de pavo, minerales, fibra de manzana, cebada integral, semillas de lino (fuente natural de &aacute;cidos grasos &omega;3), avena integral, aceite de pescado (protegido con tocoferoles naturales), glucosamina 1400 mg/kg, calabaza deshidratada, kale deshidratada, krill del ant&aacute;rtico, alga kelp, spirulina, achicoria (fuente de FOS) 1000 mg/kg, qu&iacute;noa 1000 mg/kg, br&oacute;coli deshidratado 1000 mg/kg, ar&aacute;ndanos rojos 1000 mg/kg, ar&aacute;ndanos azules 1000 mg/kg, jengibre 1000 mg/kg, condroitina 1000 mg/kg, pared celular hidrolizada de levaduras (fuente de MOS) 1000 mg/kg, romero, yucca schidigera.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPONENTES ANAL&Iacute;TICOS:&nbsp;</span>prote&iacute;na bruta 34,00%, grasa bruta 12,00%, cidos grasos omega-3 0,40%, &aacute;cidos grasos omega-6 1,60%, fibra bruta 7,50%, ceniza bruta 7,75%, calcio 1,30%, f&oacute;sforo 1,00%, energ&iacute;a metabolizable 3460 kcal/kg.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">ADITIVOS NUTRICIONALES:</span>&nbsp;Aditivos nutricionales: vitamina A 22500 UI/kg, vitamina D3 1800 UI/kg, vitamina E 450 mg/kg, vitamina C 100 mg/kg, hierro (quelato de hierro (II) de amino&aacute;cidos, hidratado) 72 mg/kg, cobre (quelato de cobre (II) de amino&aacute;cidos, hidratado) 6 mg/kg, manganeso (quelato de manganeso de amino&aacute;cidos, hidratado) 32 mg/kg, zinc (quelato de zinc de amino&aacute;cidos, hidratado) 90 mg/kg, levadura selenizada Saccharomyces cerevisiae NCYC R397, inactivada (complejo de levadura de selenio) 0,20 mg/kg, taurina 500 mg/kg, L-carnitina 1500 mg/kg. Aditivos tecnol&oacute;gicos: antioxidantes: extractos de tocoferol de aceites vegetales. Aditivos zoot&eacute;cnicos: probi&oacute;tico Bacillus subtilis C-3102 (DSM 15544) 1 x 109 UFC/kg.</p>', '', '', '', '', '', 23),
