(26, 1, 'AMANOVA ADULT MINI SENSITIVE SALMON FRESCO PERRO 2KG', '', '<p class=\"paragraph-hightlighted2\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Adult Mini Sensitive Salm&oacute;n Fresco</span></p>\r\n<p class=\"paragraph-hightlighted\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Amanova Adult Mini Sensitive es&nbsp;<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">un pienso hipoalerg&eacute;nico para perros peque&ntilde;os</span>, especialmente para aquellos que tienen digestiones sensibles o que requieran un mayor cuidado en la piel y el pelo. Preparado con salm&oacute;n fresco como &uacute;nica fuente animal, aporta importantes cantidades de &aacute;cidos grasos Omega-3, EPA y DHA que ayudar&aacute;n a cuidar de su piel, pelo y articulaciones.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-nume