 border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPOSICI&Oacute;N:</span>&nbsp;Salm&oacute;n fresco 53%, patata, guisantes, prote&iacute;na de patata, manzana, calabaza 2%, hidrolizado de salm&oacute;n, levaduras, br&oacute;coli 1%, aceite de pollo, sustancias minerales, semillas de linaza, ar&aacute;ndanos 0,30%, inulina (FOS), manano-oligosac&aacute;ridos (MOS), romero 0,10%, Yucca schidigera.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPONENTES ANAL&Iacute;TICOS:&nbsp;</span>Prote&iacute;na bruta 27%, Grasa bruta 17%, &Aacute;cidos grasos omega-3 2,5%, &Aacute;cidos grasos omega-6 1,5%, Fibras brutas 3,5%, Ceniza bruta 8%, Calcio 1,4%, F&oacute;sforo 1,1%, Energ&iacute;a metabolizable 4000 kcal/kg</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">ADITIVOS NUTRICIONALES:</span>&nbsp;Vitamina A 19000 UI/kg, vitamina D3 1750 UI/kg, vitamina E 500 mg/kg, vitamina C 100 mg/kg, hierro (quelato de hierro (II) de amino&aacute;cidos, hidratado) 63 mg/kg, cobre (quelato de cobre (II) de amino&aacute;cidos, hidratado) 5 mg/kg, manganeso (quelato de manganeso de amino&aacute;cidos, hidratado) 24 mg/kg, zinc (quelato de zinc de amino&aacute;cidos, hidratado) 85 mg/kg, selenio (L-seleniometionina) 0&#39;20 mg/kg, taurina 300 mg/kg.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">ADITIVOS TECNOL&Oacute;GICOS:</span>&nbsp;Antioxidantes: extractos de tocoferol de aceites vegetales.</p>', '', '', '', '', '', 27),
(27, 1, 'AMANOVA ADULT MATURE PESCADO BLANCO PERRO 2KG', '', '<p class=\"paragraph-hightlighted2\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Adult Mature Pescado Blanco Fresco</span></p>\r\n<p class=\"paragraph-hightlighted\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Amanova Adult Mature, es un&nbsp;<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">pienso hipoalerg&eacute;nico para perros senior</span>&nbsp;de cualquier raza o tama&ntilde;o. Lo hemos preparado &uacute;nicamente con pescado blanco fresco como &uacute;nica fuente animal ya que aporta importantes cantidades de &aacute;cidos grasos EPA, Omega-3 y Omega-6, imprescindibles para la salud cardiovascular, osteo-articular y cognitiva de los perros mayores.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Este delicioso&nbsp;<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">pienso para perros</span>&nbsp;est&aacute; formulado con ingredientes especiales como la L-carnitina para facilitar la quema de grasas y mantener una musculatura fuerte y sana, las fibras solubles e insolubles regular&aacute;n la fermentaci&oacute;n intestinal mientras que la glucosamina y condroitina mantendr&aacute;n las articulaciones fuertes, sanas y lubricadas.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Amanova Adult Mature, es una receta repleta de antioxidantes naturales id&oacute;nea para perros mayores, no contiene harinas de carne ni carnes deshidratadas, es la elecci&oacute;n perfecta para ofrecer la m&aacute;xima calidad en los a&ntilde;os m&aacute;s especiales de tu mejor amigo.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: in