sco 64% (usamos 120 kg de conejo preparado en fresco para producir 100 kg de nuestro producto), patata deshidratada, guisantes verdes enteros, fibra de manzana, levaduras (Saccharomyces cerevisiae), hidrolizado de conejo, harina de algarroba, prote&iacute;na de patata, aceite de pollo (protegido con tocoferoles naturales), minerales, semillas de lino (fuente natural de &aacute;cidos grasos &omega;3), aceite de pescado (protegido con tocoferoles naturales), boniato, tapioca, glucosamina 1400 mg/kg, br&oacute;coli deshidratado, kale deshidratada, krill del ant&aacute;rtico, alga kelp, spirulina, achicoria (fuente de FOS) 1000 mg/kg, pared celular hidrolizada de levaduras (fuente de MOS) 1000 mg/kg, calabaza deshidratada 1000 mg/kg, ar&aacute;ndanos rojos 1000 mg/kg, ar&aacute;ndanos azules 1000 mg/kg, zanahoria deshidratada 1000 mg/kg, jengibre, condroitina 1000 mg/kg, romero 500 mg/kg, yucca schidigera.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPONENTES ANAL&Iacute;TICOS:&nbsp;</span>prote&iacute;na bruta 26,00%, grasa bruta 16,00%, &aacute;cidos grasos omega-3 0,60%, &aacute;cidos grasos omega-6 1,20%, fibra bruta 4,00%, ceniza bruta 7,50%, calcio 1,20%, f&oacute;sforo 0,90%, energ&iacute;a metabolizable 3730 kcal/kg.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">ADITIVOS NUTRICIONALES:&nbsp;</span>Aditivos nutricionales: vitamina A 22000 UI/kg, vitamina D3 1800 UI/kg, vitamina E 450 mg/kg, vitamina C 100 mg/kg, hierro (quelato de hierro (II) de amino&aacute;cidos, hidratado) 63 mg/kg, cobre (quelato de cobre (II) de amino&aacute;cidos, hidratado) 5 mg/kg, manganeso (quelato de manganeso de amino&aacute;cidos, hidratado) 24 mg/kg, zinc (quelato de zinc de amino&aacute;cidos, hidratado) 85 mg/kg, levadura selenizada Saccharomyces cerevisiae NCYC R397, inactivada (complejo de levadura de selenio) 0,20 mg/kg, taurina 300 mg/kg. Aditivos tecnol&oacute;gicos: antioxidantes: extractos de tocoferol de aceites vegetales. Aditivos zoot&eacute;cnicos: probi&oacute;tico Bacillus subtilis C-3102 (DSM 15544) 1 x 109 UFC/kg.</p>', '', '', '', '', '', 15),
