omo probi&oacute;ticos, quinoa y aceite de pescado que cuidar&aacute;n de la salud renal y digestiva de tu gatito.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPOSICI&Oacute;N:</span>&nbsp;pollo preparado en fresco 66% (usamos 120 kg de pollo preparado en fresco para producir 100 kg de nuestro producto), guisantes verdes enteros, prote&iacute;na de patata, semillas de lino (fuente natural de &aacute;cidos grasos &omega;3), levaduras (Saccharomyces cerevisiae), arroz integral, hidrolizado de h&iacute;gado de pollo, aceite de pollo (protegido con tocoferoles naturales), minerales, prote&iacute;na de guisantes, tapioca, fibra de manzana 4000 mg/kg, aceite de pescado (protegido con tocoferoles naturales), calabaza deshidratada, kale deshidratada, krill del ant&aacute;rtico, alga kelp, spirulina, qu&iacute;noa 1000 mg/kg, zanahoria deshidratada 1000 mg/kg, ar&aacute;ndanos rojos, achicoria (fuente de FOS) 1000 mg/kg, pared celular hidrolizada de levaduras (fuente de MOS) 1000 mg/kg, extracto de mandarina, menta 500 mg/kg, jengibre, romero.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\