(41, 1, 'AMANOVA ADULT STERILISED  PESCADO BLANCO FRESCO GATO 1.5KG', '', '<p class=\"paragraph-hightlighted2\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Sterilised Cat Pescado Blanco Fresco</span></p>\r\n<p class=\"paragraph-hightlighted\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Amanova Sterilised Fish Delicacy es un&nbsp;<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">pienso sin cereales para gatos esterilizados</span>&nbsp;a partir de los 12 meses de edad. Preparado &uacute;nicamente con pescado blanco fresco como &uacute;nica fuente animal, contiene importantes cantidades de &aacute;cidos grasos Omega-3 y Omega-6 imprescindibles para la salud cardiovascular y para mantener la piel y el pelaje de tu gato hermoso y brillante.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	La f&oacute;rmula especial de este&nbsp;<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">pienso hipoalerg&eacute;nico</span>&nbsp;dise&ntilde;ada por veterinarios, contiene L-Carnitina que ayudar&aacute; a metabolizar las grasas y aportar&aacute; prote&iacute;nas de alta calidad que fortalecer&aacute;n la musculatura. Incluimos camomila que ayuda a calmar el estr&eacute;s, calcio y f&oacute;sforo para mantener sus huesos y dientes fuertes.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Amanova Sterilised Fish Delicacy es una receta exclusiva de&nbsp;<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">comida natural para gatos esterilizados</span>, sin harinas de carne ni carnes deshidratadas, contiene fibras diet&eacute;ticas e ingredientes especiales como probi&oacute;ticos, calabaza, jengibre y aceites de pescado, que ayudar&aacute; a mejorar la funci&oacute;n renal, la digesti&oacute;n y a prevenir la formaci&oacute;n de bolas de pelo.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPOSICI&Oacute;N:</span>&nbsp;Pescado blanco fresco 50%, prote&iacute;na de patata, guisantes, prote&iacute;na de guisantes, manzana, patata, calabaza 2%, hidrolizado de pescado, levaduras, zanahoria 2%, lignocelulosa, sustancias minerales, aceite de pollo, algarroba, naranja 0&#39;30%, extracto de malta, Psyllium, inulina (FOS), manano-oligosac&aacute;ridos (MOS), romero 0&#39;05%, manzanilla, Yucca schidigera.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPONENTES ANAL&Iacute;TICOS:&nbsp;</span>Prote&iacute;na bruta 37%, Grasa bruta 11,5%, Fibras brutas 6%, Ceniza bruta 8%, Calcio 1,1%, F&oacute;sforo 1%, Energ&iacute;a metabolizable 3550 kcal/kg</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">ADITIVOS NUTRICIONALES:</span>&nbsp;vitamina A 19000 UI/kg, vitamina D3 1850 UI/kg, vitamina E 700 mg/kg, vitamina C 75 mg/kg, hierro (quelato de hierro (II) de amino&aacute;cidos, hidratado) 63 mg/kg, cobre (quelato de cobre (II) de amino&aacute;cidos, hidratado) 5 mg/kg, manganeso (quelato de manganeso de amino&aacute;cidos, hidratado) 24 mg/kg, zinc (quelato de zinc de amino&aacute;cidos, hidratado) 75 mg/kg, selenio (L-seleniometionina) 0&#39;2 mg/kg, taurina 1200 mg/kg, DL-metionina 1000 mg/kg, L-carnitina 500 mg/kg.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">ADITIVOS TECNOL&Oacute;GICOS:</span>&nbsp;Antioxidantes: extractos de tocoferol de aceites vegetales. Reguladores de la acidez: Bisulfato s&oacute;dico 5000 mg/kg.</p>', '', '', '', '', '', 12),
(42, 1, 'AMANOVA LATA 15 EN GELATINA SARDINAS Y GAMBAS GATO 70GR', '', '<p class=\"paragraph-hightlighted2\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Amanova Sardinas y Gambas en gelatina</span></p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Una recompensa muy tentadora para los gatos que no se resisten al sabor del pescado. Una receta 100% natural preprada con deliciosos filetes de sardinas y gambas frescas, es tan deliciosamente nutritiva como si estuviera preparada para ti. Este alimento complementario para mascotas est&aacute; ideado para disfrutarlo con una alimentaci&oacute;n completa y as&iacute; mantener una dieta saludable y equilibrada. Las sardinas y los camarones son ricos en prote&iacute;nas y contienen minerales esenciales como el potasio y el calcio que ayudar&aacute;n a mantener los huesos y dientes de tu gato en un estado &oacute;ptimo. Para gatos m&aacute;s felices y saludables, dales Amanova.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPOSICI&Oacute;N:</span><br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Sardina 55%, gambas 6%, agentes gelificantes 1%, agua 38%.&nbsp;</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPONENTES ANAL&Iacute;TICOS:</span><br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Prote&iacute;na bruta 9%<br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Grasa bruta 1%<br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Fibra bruta 1%<br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Ceniza bruta 3,50%<br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Humedad 85%</p>', '', '', '', '', '', 12),
(43, 1, 'AMANOVA LATA 06 EN CALDO POLLO Y ATUN GATO 70GR', '', '<p class=\"paragraph-hightlighted2\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Amanova Pollo y At&uacute;n en caldo</span></p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Mima a tu a felino con esta receta irresistible y 100% natural. Elaborada con los mejores filetes de pechuga de pollo y delicioso at&uacute;n fresco, esta receta es tan deliciosa y nutritiva como si estuviera hecha para ti. Este alimento complementario para mascotas est&aacute; dise&ntilde;ado como un manjar ocasional ideal para disfrutar junto con su alimentaci&oacute;n completa Amanova. Alto en prote&iacute;nas y f&aacute;cil de digerir, el pollo aporta taurina para apoyar el funcionamiento del coraz&oacute;n y los ojos, mientras que el at&uacute;n contiene &aacute;cidos grasos Omega 3 que ayudar&aacute; a mantener una piel sana y un pelaje brillante. Para que tu gato sea m&aacute;s feliz y saludable, dale Amanova.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPOSICI&Oacute;N:</span><br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Pollo 65%, at&uacute;n 5%, arroz 1%, agua 29%.&nbsp;</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPONENTES ANAL&Iacute;TICOS:</span><br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Prote&iacute;na bruta 8%<br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Grasa bruta 1%<br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Fibra bruta 1%<br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Ceniza bruta 1%<br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Humedad 85%</p>', '', '', '', '', '', 12),
(44, 1, 'AMANOVA LATA 04 EN CALDO POLLO Y SURIMI GATO 70GR', '', '<p class=\"paragraph-hightlighted2\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Amanova Pollo y Surimi en caldo</span></p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Deleita el paladar de tu felino con este manjar natural. Preparado con pechuga de pollo y delicioso surimi de pescado, es tan sabroso y nutritivo como si estuviera hecho para ti. Con el fin de conseguir una dieta sana y equilibrada, alimenta a tu gato con esta comida complementaria junto con pienso Amanova. Alto en prote&iacute;nas y f&aacute;cil de digerir, el pollo es una buena fuente de taurina, que apoya el funcionamiento saludable del coraz&oacute;n y los ojos de tu peludo. &iexcl;Por que queremos gatos felices y saludables!</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPOSICI&Oacute;N:</span><br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Pollo 65%, surimi 5%, arroz 1%, agua 29%.&nbsp;</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPONENTES ANAL&Iacute;TICOS:</span><br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Prote&iacute;na bruta 8%<br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Grasa bruta 1%<br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Fibra bruta 1%<br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Ceniza bruta 1%<br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Humedad 85%</p>', '', '', '', '', '', 23),
(45, 1, 'AMANOVA LATA 14 EN GELATINA ATUN Y SARDINAS GATO 70GR', '', '<p class=\"paragraph-hightlighted2\" style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Amanova At&uacute;n y Sardinas en gelatina</span></p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Sorprende a tu gato con un fest&iacute;n de pescado. Nuestra receta 100% natural est&aacute; compuesta de at&uacute;n de primera calidad y sardinas frescas, y es tan deliciosamente nutritiva como si estuviera hecha para ti. Este alimento complementario para mascotas est&aacute; preparado como un placer ocasional y disfrutarlo con una alimentaci&oacute;n completa Amanova. Alto en prote&iacute;nas, el at&uacute;n contiene sales minerales esenciales para apoyar la salud &oacute;sea y &aacute;cidos grasos Omega 3 para una piel sana y un pelaje brillante. Las sardinas tambi&eacute;n incluyen minerales esenciales como el potasio y el calcio, adem&aacute;s de vitamina A para beneficiar sus ojos y piel. Para gatos m&aacute;s felices y saludables, dales Amanova.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPOSICI&Oacute;N:</span><br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	At&uacute;n 55%, sardina 6%, agentes gelificantes 1,30%, agua 37,70%.&nbsp;</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPONENTES ANAL&Iacute;TICOS:</span><br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Prote&iacute;na bruta 10%<br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Grasa bruta 1%<br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Fibra bruta 1%<br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Ceniza bruta 1%<br style=\"box-sizing: border-box; outline: none; box-shadow: none;\" />\r\n	Humedad 85%</p>', '', '', '', '', '', 13);
